import './welcome.css';

function Welcome() {
  return (
    <div className="welcome">
      <header className="welcome-body">
        <label className="welcome-body-text">
          Welcome to
        </label>
        <label className="welcome-body-sub-text">
          Amazing Project
        </label>
      </header>
    </div>
  );
}

export default Welcome;
